builder.init(process.env.REACT_APP_BUILDER_KEY!);


const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);

// Render the App component into the root div in your HTML file
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
